import SwipeableViews from "react-swipeable-views";

const styles = {
    slide: {
        padding: 15,
        minHeight: 100,
        color: "#fff",
    },
    slide1: {
        background: "#FEA900",
    },
    slide2: {
        background: "#B3DC4A",
    },
    slide3: {
        background: "#6AC0FF",
    },
};

const IndexView = () => (
    <main>
        <SwipeableViews enableMouseEvents></SwipeableViews>
    </main>
);

export default IndexView;
